define(['jquery','Magento_PageBuilder/js/utils/map'],function($,GoogleMap){'use strict';return function(config,element){var locations,controls,mapOptions={};element=element[0];if(element!==undefined&&element.hasAttribute('data-locations')){if(element.getAttribute('data-locations')==='[]'){$(element).hide();return;}
locations=JSON.parse(element.getAttribute('data-locations'));locations.forEach(function(location){location.position.latitude=parseFloat(location.position.latitude);location.position.longitude=parseFloat(location.position.longitude);});controls=element.getAttribute('data-show-controls');mapOptions.disableDefaultUI=controls!=='true';mapOptions.mapTypeControl=controls==='true';new GoogleMap(element,locations,mapOptions);}};});